import Nav from './components/Nav'
import PageLeft from './components/PageLeft'
import PageRight from './components/PageRight'
import './styles.css'

function App() {
  // Statisk liste for overskrifter p책 sidene
  const headerList = [
    {
      id: 1,
      headerLeft: 'Design i Human',
      headerRight: 'Design is human. Design making ideas real',
    },
    { id: 2, headerLeft: 'Design i Human', headerRight },
    { id: 3, headerLeft: 'Design i Human', headerRight },
  ]

  // onClick for 책 trigge noe skal skj
  const handleClick = (event) => {
    event.preventDefault()
  }

  return (
    <>
      <Nav />
      <main>
        <PageLeft />
        <PageRight />
      </main>
    </>
  )
}

export default App
